import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />

      </header>
      <button id = "first-button" value = "Click me">
        Click Here
      </button>
    </div>
  );
}

export default App;
